def n_gram_iter(input_iterator, n):
    return zip(*(islice(it, i, None) for i, it in enumerate(tee(iter(input_iterator), n))))


def create_conc_main(inp_fh=sys.stdin, out_fh=sys.stdout, conc_len=5):
    ngram_len = conc_len * 2 + 1
    for line in inp_fh:
        line = line.rstrip().split(' ')
        for entry in n_gram_iter(line, ngram_len):
            pre = entry[:5]
            word = entry[5]
            post = entry[6:]
            if len(word) >= 4 and LOWERCASE_LETTERS_HUN.issuperset(word) and word not in NON_WORDS:
                print(word, ' '.join(pre), ' '.join(post), sep='\t', file=out_fh)


if __name__ == '__main__':
    create_conc_main()
